list.item:
Assess TG levels carefully before initiating therapy. Identify other causes (e.g., diabetes mellitus, hypothyroidism, medications) of high TG levels and manage as appropriate. [see
Indications and Usage (1)
].

Omega-3-acid ethyl esters capsules should be used with caution in patients with known sensitivity or allergy to fish and/or shellfish [see
Warnings and Precautions (5.2)
].

Advise patients that use of lipid-regulating agents does not reduce the importance of adhering to diet [see
Dosage and Administration (2)
].

Advise patients not to alter omega-3-acid ethyl esters capsules in any way and to ingest intact capsules only [see
Dosage and Administration (2)
].
